useEffect(() => {
    const getList = async () => {
        try {
            await HandleFetch().then((data) => {
                setPro(data);
            });
        } catch (err) {
            console.log(err);
        }
    };
    getList();
}, []);

<div className='menu-item'>
    {product &&
    product.map((item) => {
        return (
            <div
            style={{ backgroundImage: `url(${item.image})` }}
            className='menu-item-image'
            >
                <h3>{item.name}</h3>
                <p>{item.description}</p>
                <p>{item.amount}</p>
                <button className='btn'> Add to basket </button>
            </div>
        );
    })}
</div>
